import React, {Component} from 'react';
import axios from 'axios';

export default class chatRooms extends Component {
  constructor(props) {
    super(props);

    this.state = {
      error: null,
      isLoaded: false,
      items: []
    }
  }

  componentDidMount() {
    axios.post('http://localhost:5000/chatRoom/searchRoom')
    .then((req, res) => {
      console.log(req);
      this.setState({
        isLoaded: true,
        items: req.data
      })
    })
    .catch(err => {
      console.log(err);
    })
  }

  render() {
    const { error, isLoaded, items } = this.state;
    if (error) {
      return <div>Ошибка: {error.message}</div>;
    } else if (!isLoaded) {
      return <div>Загрузка...</div>;
    } else {
      return (
        <ul>
          {items.map(item => (
            <li key={item.id}>
              {item.title} {item.id}
            </li>
          ))}
        </ul>
      );
    }
  }
}
